//importing css and js
import '../assets/css/style.css';
import '../assets/css/color-1.css';
import '../assets/js/script';


// importing images for home component
import project1 from '../assets/img/project-1.jpeg';
import project2 from '../assets/img/project-2.jpg';
import project3 from '../assets/img/project-3.jpeg';
import project4 from '../assets/img/project-4.jpeg';
import project5 from '../assets/img/project-5.jpg';
import project6 from '../assets/img/project-6.jpg';


const Portfolio
    = () => {
        return (
            <section className='portfolio section'>
                <div className='container'>
                    <div className='row'>
                        <div className='section-title padd-15'>
                            <h2>Portfolio</h2>
                        </div>
                    </div>
                    <div className='row'>
                        <div className='portfolio-heading padd-15'>
                            <h2>My Last Project: </h2>
                        </div>
                    </div>
                    <div className='row'>
                        {/* ========portfolio item start ========*/}
                        <div className='portfolio-item padd-15'>
                            <div className='prtfolio-item-inner shadow-dark'>
                                <div className='prtfolio-img'>
                                    <img src={project1} alt='project1' />
                                </div>
                            </div>
                        </div>
                        {/* ========portfolio item end ========*/}


                        {/* ========portfolio item start ========*/}
                        <div className='portfolio-item padd-15'>
                            <div className='prtfolio-item-inner shadow-dark'>
                                <div className='prtfolio-img'>
                                    <img src={project2} alt='project2' />
                                </div>
                            </div>
                        </div>
                        {/* ========portfolio item end ========*/}


                        {/* ========portfolio item start ========*/}
                        <div className='portfolio-item padd-15'>
                            <div className='prtfolio-item-inner shadow-dark'>
                                <div className='prtfolio-img'>
                                    <img src={project3} alt='project3' />
                                </div>
                            </div>
                        </div>
                        {/* ========portfolio item end ========*/}


                        {/* ========portfolio item start ========*/}
                        <div className='portfolio-item padd-15'>
                            <div className='prtfolio-item-inner shadow-dark'>
                                <div className='prtfolio-img'>
                                    <img src={project4} alt='project4' />
                                </div>
                            </div>
                        </div>
                        {/* ========portfolio item end ========*/}


                        {/* ========portfolio item start ========*/}
                        <div className='portfolio-item padd-15'>
                            <div className='prtfolio-item-inner shadow-dark'>
                                <div className='prtfolio-img'>
                                    <img src={project5} alt='project5' />
                                </div>
                            </div>
                        </div>
                        {/* ========portfolio item end ========*/}


                        {/* ========portfolio item start ========*/}
                        <div className='portfolio-item padd-15'>
                            <div className='prtfolio-item-inner shadow-dark'>
                                <div className='prtfolio-img'>
                                    <img src={project6} alt='project6' />
                                </div>
                            </div>
                        </div>
                        {/* ========portfolio item end ========*/}
                    </div>
                </div>
            </section>


        )
    }


export default Portfolio;
